    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click notifications button to open modal
    await page.waitForSelector('#notificationsBtn');
    await page.click('#notificationsBtn');
    await page.waitForTimeout(1000); // Wait for modal animation

    // Wait for notifications to load and take screenshot
    await page.waitForSelector('.notification-item', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_notifications_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_notifications_open.png'));

    // Extract all notification time elements
    const timeElements = await page.$$eval('.notification-time', elements => 
      elements.map(el => el.textContent.trim())
    );

    // Convert relative times to timestamps
    const timestamps = timeElements.map(timeText => {
      const now = new Date();
      const matches = timeText.match(/(\d+)\s*(s|m|h|d)/);

      if (!matches) return now.toISOString();

      const value = parseInt(matches[1]);
      const unit = matches[2];

      switch(unit) {
        case 's': now.setSeconds(now.getSeconds() - value); break;
        case 'm': now.setMinutes(now.getMinutes() - value); break;
        case 'h': now.setHours(now.getHours() - value); break;
        case 'd': now.setDate(now.getDate() - value); break;
      }

      return now.toISOString();
    });

    // Take final screenshot with highlighted time elements
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_times_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_times_extracted.png'));

    return {
      success: true,
      action: "Extracted all notification time information and converted to timestamps",
      extractedData: {
        timeElements,
        timestamps
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to extract notification times",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

