    // Extract all notification time elements
    const timeElements = await page.$$eval('.notification-time', elements => 
      elements.map(el => el.textContent.trim())
    );

    // Convert time strings to timestamps (assuming format like "2 hours ago", "5 minutes ago")
    const timestamps = timeElements.map(timeStr => {
      const now = new Date();
      const matches = timeStr.match(/(\d+)\s+(hour|minute|second)s?\s+ago/);

      if (matches) {
        const value = parseInt(matches[1]);
        const unit = matches[2];

        switch(unit) {
          case 'hour':
            now.setHours(now.getHours() - value);
            break;
          case 'minute':
            now.setMinutes(now.getMinutes() - value);
            break;
          case 'second':
            now.setSeconds(now.getSeconds() - value);
            break;
        }
        return now.getTime();
      }
      return null;
    }).filter(ts => ts !== null);

    return {
      success: true,
      action: "Collected notification times and converted to timestamps",
      extractedData: {
        timeStrings: timeElements,
        timestamps: timestamps
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to collect notification times",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
